function ExpenseItem () {

    const expenseDate = new Date(2022, 1, );
    return (
        <div className="expense-item">
            <div>January 26th 2022</div>
            <div className="expense-item__description">
                <h2>Car Insurance</h2>
                <div className="expense-item__price">297.58</div>
            </div>

        </div>    

    )

}

export default ExpenseItem;
